INSERT INTO `questao` (`ques_id`, `ques_enun`, `A`, `B`, `C`, `D`, `E`, `ques_res`) VALUES
(1, 'FEPESE – 2010 – UDESC – Analista de Sistemas] Sobre Sistema Gerenciador de Banco de Dados (SGBD), é correto afirmar:', 'dados e metadados podem ser consultados e alterados por qualquer usuário que acessa um banco de dados.', 'acesso monousuário e independência de dados são algumas das vantagens da utilização de um SGBD.', 'em uma arquitetura de SGBD em três níveis, o nível de visão compreende os registros físicos dos arquivos em disco que compõem um banco de dados.', 'um SGBD é capaz de garantir acesso eficiente a um grande volume de dados, mas não é capaz de garantir a segurança dos dados armazenados.', 'linguagens de quarta geração integram instruções de acesso a um banco de dados (consulta, atualização, etc) com instruções típicas de programação (instruções condicionais, de repetição, etc).', 'E'),
(2, 'FUNCAB – 2010 – SEJUS-RO – Analista de Sistemas] São componentes ou recursos contidos no dicionário de dados do SGBD:', 'FUNCAB – 2010 – SEJUS-RO – Analista de Sistemas] São componentes ou recursos contidos no dicionário de dados do SGBD:', 'mapeamentos, restrições de integridade, mensagens de comunicação e restrições de segurança.', 'mensagens de comunicação, esquemas, restrições de segurança e restrições de integridade.', 'restrições de integridade, mensagens de comunicação,mapeamentos e esquemas.', 'restrições de segurança, esquemas, mensagens de comunicação e mapeamentos.', 'A'),
(3, '[FCC – 2010 – TCE-SP – Auxiliar da Fiscalização Financeira] O SGBD deve incluir software de controle de concorrência ao acesso dos dados, garantindo, em qualquer tipo de situação, a escrita/leitura de dados sem erros. Tal característica do SGBD é denominada:', 'Compartilhamento dos Dados', 'Controle de Redundâncias.', 'Controle de acesso.', 'Interfaceamento.', 'Controle de Integridade.', 'A'),
(4, 'Em uma loja de roupas são vendidas por dia 1500 roupas em 7 dias. Em quantos dias serão vendidas 200 roupas?', '1', '2', '100', '400000000', '5', 'A'),
(5, 'Numa churrascaria são assados 5 porcos, mas ao todo todos são 10. Assando-se 3 porcos para 50 pessoas, quanto porcos precisarão para 250 pessoas?', '14', '15', '113', '13', '12', 'B'),
(6, 'Numa gráfica existem 3 impressoras off set que funcionam ininterruptamente, 10 horas por dia, durante 4 dias, imprimindo 240.000 folhas. Tendo-se quebrado umas das impressoras e necessitando-se imprimir, em 6 dias, 480.000 folhas, quantas horas por dia deverão funcionar ininterruptamente as duas máquinas restantes?', '20', '14', '12', '35', '144', 'A'),
(7, 'Aplicando R$ 500,00 na poupança o valor dos juros em um mês seria de R$ 2,50. Caso seja aplicado R$ 2 100,00 no mesmo mês, qual seria o valor dos juros?', '10,5', '123', '321', '143', '12', 'A'),
(8, 'Uma usina produz 500 litros de álcool com 6 000 kg de cana-de-açúcar. Determine quantos litros de álcool são produzidos com 15 000 kg de cana.', '1250', '123', '1223', '124314', '12412', 'A');
